import React from 'react';

function Podcasts() {
  return (
    <div>
      <h1>Podcasts</h1>
      <br />
      <p>Click on the link below to see some of my favorite Podcasts.</p>
      <a href="https://baconsale.com/">https://baconsale.com/</a>
    </div>
  );
}

export default Podcasts;
